import { Link } from "react-router-dom";
import "./styles.css"; // Ensure this is imported for CSS styles

function Home() {
  return (
    <div className="home-container">
      <Link to="/login" className="nav-button login-button">
        Login Page
      </Link>
      <Link to="/dashboard" className="nav-button home-button">
        Home
      </Link>
    </div>
  );
}

export default Home;
